import com.eviware.soapui.support.XmlHolder def myTestCase = context.testCase def counter,next,previous,size, mid File tickerEnumFile = new File("C:/Users/z003t24a/Desktop/UDIS_Crashen.txt") //File öffnen List lines = tickerEnumFile.readLines() // Zeilen auslesen size = lines.size.toInteger() // Anzahl der Zeilen in Variable schreiben propTestStep = myTestCase.getTestStepByName("Property - Looper") // Property Teststep Variable erzeugen propTestStep.setPropertyValue("Total", size.toString()) // Feld Total in Property Teststep mit der Anzahl der Zeilen befüllen counter = propTestStep.getPropertyValue("Count").toString() // aktuellen Count Wert aus dem Property Teststep holen counter= counter.toInteger() // Typecast von String zu Int next = (counter > size-2? 0: counter+1) // Abfragen ob die nächste Zeile schon die Letze ist tempValue = lines[counter] // Wert der aktuellen Zeile in Variable schreiben propTestStep.setPropertyValue("Value", tempValue) // Wert der aktuellen Zeile in Property Teststep schreiben propTestStep.setPropertyValue("Count", next.toString()) // Index der nächsten Zeile in Property Teststep eintragen next++ // next hochzählen log.info "Reading line : ${(counter+1)} / $lines.size" // Ausgabe der Zeile und des Indexes propTestStep.setPropertyValue("Next", next.toString()) // Index Next in Property Teststep schreiben log.info "Value '$tempValue' -- updated in $propTestStep.name" // Ausgabe des upgedateten Wertes
mid = propTestStep.getPropertyValue("messageid").toString() mid = mid.toInteger() + 1 propTestStep.setPropertyValue("messageid", mid.toString())
if (counter == size-1) // Abfrage ob die aktuelle Zeile schon die letze ist { propTestStep.setPropertyValue("StopLoop", "T") // Feld StopLoop im Property Teststep auf True setzen log.info "Setting the stoploop property now..." // Ausgab, dass letze Zeile erreicht wurde } else if (counter==0) { def runner = new com.eviware.soapui.impl.wsdl.testcase.WsdlTestCaseRunner(testRunner.testCase, null) propTestStep.setPropertyValue("StopLoop", "F") //Feld Stoploop auf False setzen } else { propTestStep.setPropertyValue("StopLoop", "F") // Feld Stoploop auf False setzen }

def myTestCase = context.testCase

def runner
propTestStep = myTestCase.getTestStepByName("Property - Looper") // get the Property TestStep
endLoop = propTestStep.getPropertyValue("StopLoop").toString()

if (endLoop.toString() == "T" || endLoop.toString()=="True" || endLoop.toString()=="true")
{
 log.info ("Exit Groovy Data Source Looper")
 assert true
}
else
{
 testRunner.gotoStepByName("Groovy Script - Datasource") //setStartStep
}

